import React, { useState } from "react";
import { motion } from "framer-motion"; // For animations

const CropPrediction = () => {
    const [formData, setFormData] = useState({
        N: "",
        P: "",
        K: "",
        temperature: "",
        humidity: "",
        ph: "",
        rainfall: "",
    });

    const [recommendedCrop, setRecommendedCrop] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setRecommendedCrop(null);
        setError(null);
        setLoading(true);

        try {
            const response = await fetch("http://localhost:5000/api/auth/predict", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({
                    N: parseFloat(formData.N),
                    P: parseFloat(formData.P),
                    K: parseFloat(formData.K),
                    temperature: parseFloat(formData.temperature),
                    humidity: parseFloat(formData.humidity),
                    ph: parseFloat(formData.ph),
                    rainfall: parseFloat(formData.rainfall),
                }),
            });

            const data = await response.json();
            setLoading(false);

            if (response.ok) {
                setRecommendedCrop(data.recommended_crop);
            } else {
                setError(data.message || "Error predicting crop");
            }
        } catch (err) {
            setLoading(false);
            setError("Failed to connect to the backend");
        }
    };

    return (
        <div style={styles.pageContainer}>
            <motion.div
                style={styles.container}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5 }}
            >
                <h1 style={styles.header}>üå± Crop Prediction</h1>

                <form style={styles.form} onSubmit={handleSubmit}>
                    {Object.keys(formData).map((key) => (
                        <motion.div
                            key={key}
                            style={styles.inputGroup}
                            initial={{ opacity: 0, x: -20 }}
                            animate={{ opacity: 1, x: 0 }}
                            transition={{ delay: 0.1 * Object.keys(formData).indexOf(key) }}
                        >
                            <label style={styles.label} htmlFor={key}>
                                {key.charAt(0).toUpperCase() + key.slice(1)}:
                            </label>
                            <input
                                type="number"
                                id={key}
                                name={key}
                                value={formData[key]}
                                onChange={handleChange}
                                style={styles.input}
                                required
                            />
                        </motion.div>
                    ))}
                    <motion.button
                        type="submit"
                        style={styles.submitButton}
                        disabled={loading}
                        whileHover={{ scale: 1.05 }}
                        whileTap={{ scale: 0.95 }}
                    >
                        {loading ? "Predicting..." : "Predict Crop"}
                    </motion.button>
                </form>

                {recommendedCrop && (
                    <motion.div
                        style={styles.resultContainer}
                        initial={{ scale: 0.8, opacity: 0 }}
                        animate={{ scale: 1, opacity: 1 }}
                        transition={{ duration: 0.3 }}
                    >
                        <h2 style={styles.result}>üåæ Recommended Crop:</h2>
                        <p style={styles.cropName}>{recommendedCrop}</p>
                    </motion.div>
                )}
                {error && (
                    <motion.div
                        style={styles.errorContainer}
                        initial={{ scale: 0.8, opacity: 0 }}
                        animate={{ scale: 1, opacity: 1 }}
                        transition={{ duration: 0.3 }}
                    >
                        <h2 style={styles.error}>‚ö†Ô∏è {error}</h2>
                    </motion.div>
                )}
            </motion.div>
        </div>
    );
};

const styles = {
    pageContainer: {
        height: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#000", // Black background
        color: "#0f0", // Neon green text
    },
    container: {
        background: "rgba(20, 20, 20, 0.95)",
        padding: "30px",
        borderRadius: "12px",
        boxShadow: "0px 10px 20px rgba(0, 255, 0, 0.2)",
        width: "450px",
        textAlign: "center",
    },
    header: {
        fontSize: "22px",
        fontWeight: "bold",
        color: "#0f0",
        marginBottom: "15px",
    },
    form: {
        display: "flex",
        flexDirection: "column",
        gap: "10px",
    },
    inputGroup: {
        textAlign: "left",
    },
    label: {
        display: "block",
        fontWeight: "600",
        color: "#0f0",
        marginBottom: "5px",
    },
    input: {
        width: "100%",
        padding: "10px",
        borderRadius: "6px",
        border: "1px solid #0f0",
        fontSize: "16px",
        outline: "none",
        transition: "border-color 0.3s, transform 0.3s",
        boxSizing: "border-box",
        backgroundColor: "#111",
        color: "#0f0",
    },
    submitButton: {
        width: "100%",
        padding: "12px",
        fontSize: "16px",
        fontWeight: "bold",
        color: "#000",
        backgroundColor: "#0f0",
        border: "none",
        borderRadius: "6px",
        cursor: "pointer",
        transition: "background 0.3s, transform 0.3s",
    },
    resultContainer: {
        marginTop: "20px",
        padding: "15px",
        backgroundColor: "rgba(0, 255, 0, 0.1)",
        borderRadius: "8px",
        textAlign: "center",
    },
    result: {
        color: "#0f0",
        fontWeight: "bold",
    },
    cropName: {
        fontSize: "20px",
        fontWeight: "bold",
        color: "#0f0",
    },
    errorContainer: {
        marginTop: "20px",
        padding: "15px",
        backgroundColor: "#ff000033",
        borderRadius: "8px",
        textAlign: "center",
    },
    error: {
        color: "#ff4444",
        fontWeight: "bold",
    },
};

export default CropPrediction;
